import "./Quote.css";

function GetQoute() {
	const [click, setClick] = useState(false);
	const handleClick = () => setClick(!click);

	return (
		<div className="ctForm">
			<button className="btn">Get Quote</button>
		</div>
	);
}
export default GetQoute;
